  google.protobuf.StringValue carousel_filter = 419;

  // Bundle precheckout item page parent item id
  google.protobuf.Int64Value parent_item_id = 420;

  // The ID of the card's bundle.
  google.protobuf.StringValue bundle_id = 421;

  // An array of each item ID within the bundle.
  repeated google.protobuf.StringValue item_ids = 422;

  // Derived from M_CARD_CLICK.SCHEDULE_DELIVERY_AVAILABLE
  google.protobuf.StringValue schedule_delivery_available = 423;

  // spell corrected query - for e.g. "chicken"
  google.protobuf.StringValue spell_corrected_query = 424;

  // query intent from global search query intent understanding - for e.g. "FOOD_CUISINE"
  google.protobuf.StringValue query_intent = 425;
}
